import classNames from 'classnames'
import styles from './styles.module.css'

export const Users = () => {
    const data = []

    for (let i=0; i< 100; i++) {
        data.push({'Наименование': 'UM System Group',
        "E-mail": 'example@mail.ru',
        "Телефон": '+77007007070',
        "Роль": 'admin',
        "Франшиза": 'Шымкент, Сарыагаш',
        "баланс": '250000'})
    }

    const headers = ['#'].concat(Object.keys(data[0]))
    
    return (
        data
        ? <div className={styles.table}>
            <div className={styles.table_header}>
                {headers.map((el, idx) => {
                    return (
                        <div key={idx} className={classNames(styles.table_title, {
                            [styles.table_cell__name]: index==0,
                        })}>{el.toUpperCase()}</div>
                    )
                })}
            </div>
            <div className={styles.table_content}>
                {data.map((el, idx) => {
                    const cellsValues = Object.values(el);

                    return (
                        <div className={styles.table_row}>
                            <div className={styles.table_cell}>{idx+1}</div>
                            {cellsValues.map((cell, index) => {
                                return <div className={classNames(styles.table_cell, {
                                    [styles.table_cell__name]: index==0,
                                })}>{cell}</div>
                            })}
                        </div>
                    )
                })}
            </div>
        </div>
        : <div>no data</div>
    )
}
